
let _ws = null;
let _ws_flag = false;
let _ws_stop = false;
let re = null;
let status_label = null;
let msg_label = null;
let lang = 'ja-JP';

let RecogEngine = function(lang){
    let wsr = new webkitSpeechRecognition();
    wsr.lang = lang;
    wsr.onstart = function(){
        this.next = new RecogEngine(lang);
        status_label.innerHTML = '音声待機';
    };
    wsr.onspeechstart = function(event){
        status_label.innerHTML = '認識中';
    };
    wsr.onresult = function(event){
        let speech = event.results[0][0].transcript;
        _ws.send('0'+speech);
        msg_label.innerHTML = speech;
    };
    wsr.onspeechend = function(){
        this.next.obj.start();
    };
    wsr.onerror = function(event){
        switch (event.error){
            case 'no-speech':
                msg_label.innerHTML = '';
                break;
            default:
                msg_label.innerHTML = 'エラーが発生';
                _ws.send('2'+event.error);
                window.close();
                break;
        }
        this.next.obj.start();
    };
    wsr.onend = function(){
        on_listening = false;
        this.sr = null;
        this.next = null;
    };
    this.obj = wsr;
    this.flag = false;
    this.obj.sr = this;
    this.obj.next = null;
}

function onLoad(){
    if (getParam('lang') != null){
        lang = getParam('lang');
    }
    resizeTo(330, 400);
    status_label = document.getElementById('status');
    msg_label = document.getElementById('msg');
    document.body.style.backgroundImage = "url('data:image/png;base64,')";
    _ws = new WebSocket(getWSAdress());
    _ws.onopen = function() {
        _ws_flag = true;
        re = new RecogEngine(lang);
        status_label.innerHTML = 'マイク使用許可をしてください';
        re.obj.start();
        msg_label.innerHTML = '喋ってください';
    };
    _ws.onmessage = function(event){
        if ('close' == event.data){
            _ws_stop = true;
            window.close();
        }
    };
    setTimeout(function(){
        if (_ws_flag) { return; }
        window.close();
    }, 15000);
}

function onUnload(){
    if (!_ws_stop){
        _ws.send('1close');
        _ws.close();
    }
}

function getParam(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}

function getWSAdress(){
    let host = location.host;
    return "ws://"+host;
}